import React from 'react';
import ComponentLv3 from './ComponentLV3';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const ComponentLv2 = (prop) => {



  // const rows = [
  //   createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  //   createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  //   createData('Eclair', 262, 16.0, 24, 6.0),
  //   createData('Cupcake', 305, 3.7, 67, 4.3),
  //   createData('Gingerbread', 356, 16.0, 49, 3.9),
  // ];

  const {navigationData,webCategoryData} = prop;


  return <div>ComponentLv2
  <p>{JSON.stringify(navigationData) }</p>

    <ComponentLv3 
     webCategoryData={webCategoryData}
    />
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>id</TableCell>
            <TableCell align="right">key</TableCell>
            <TableCell align="right">name</TableCell>
            <TableCell align="right">type</TableCell>
            <TableCell align="right">icon</TableCell>
            <TableCell align="right">navigation_id</TableCell>
            <TableCell align="right">comment</TableCell>
            <TableCell align="right">sequence</TableCell>
            <TableCell align="right">active</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>
          {navigationData.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell align="right">{row.id}</TableCell>
              <TableCell align="right">{row.key}</TableCell>
              <TableCell align="right">{row.name}</TableCell>
              <TableCell align="right">{row.type}</TableCell>
              <TableCell align="right">{row.icon}</TableCell>
              <TableCell align="right">{row.navigation_id}</TableCell>
              <TableCell align="right">{row.comment}</TableCell>
              <TableCell align="right">{row.sequence}</TableCell>
              <TableCell align="right">{row.active}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  </div>;
};
export default ComponentLv2;
